import ReactDOM from 'react-dom'
import React from 'react'
import './index.css'
import Hamburger from './hamburger-menu.svg'

function Navbar() {
    return (
        <header class="navbar-box navbar-border navbar-position navbar-text">
            <div id="header-text">
                Museum
            </div>
        </header>
    )
}


function Manytests() {
    return (
        [
            <Navbar key="navbar"/>,
        ]
    )
}

ReactDOM.render(
    <Manytests />,
    document.getElementById('root')
);
